const Invoice = require("../models/invoicemodel");
const Prodcut = require("../models/productmodel");
const pdfMake = require('pdfmake/build/pdfmake');
const pdfFonts = require('pdfmake/build/vfs_fonts');
pdfMake.vfs = pdfFonts.pdfMake.vfs;
const createinvoice = async (req,res)=>{
    try {
        const bodyData = Object.values(req.body);

        // Extracting product data using map()
        const productDataArray = bodyData[0]
          ? Object.keys(bodyData[0]).map(productId => {
              const productData = bodyData[0][productId];
              return {
                productId,
                productName: productData.name,
                productOrderNumber: productData.ordernumber,
                productINnumber: productData.INnumber,
                productICnumber: productData.ICnumber,
                productmodel: productData.model,
                productfinalprice: productData.finalprice,
                productid: productData.id,
                productquantity: productData.quantity,
              };
            })
          : [];
          const productids = productDataArray.map((data) => data.productid)
          
      
        // Extracting client data using map()
        const clientData = bodyData[1] || {};
        const name = clientData.clientname
        const email= clientData.email
        const address = clientData.address
        const contact = clientData.contactnumber
        const invoicenumber = clientData.invoicenumber
       
       
        const dataPromises = productDataArray.map((data) => {
           return Prodcut.findByIdAndUpdate(data.productid, {$inc: {quantity : -data.productquantity}});
           
        }) 
        await Promise.all(dataPromises) 
        const products = await Prodcut.find({_id: { $in: productids }})
        
        const newinvoice = await Invoice.create({User:req.user.id,date:Date.now(),productIdData:bodyData});
       const date = new Date()
      
        const docDefinition = {
          
          content: [
           
            { 
              columns: [
                
                {
                  text: 'INVOICE ',
                  alignment: 'left',
                  style: 'header',
                  
                },
                { style:'imgcell',
                  image: 'data:image/png;base64,',
                  width: 120,
                  height: 40,
                  alignment: 'right',
                },
              ],
            },
            {style:'subheader',
              table: { 
                widths: ['auto', 'auto',],
                body: [
                  [ {text:'Date',style:'cell'},{text:'Invoice Number',style:'cell'},],
                  [date.toDateString(),invoicenumber]
                ],
              },
            },
            {style:'tableHeader',
              table: { 
                 
                widths: ['auto', 'auto','auto','*'],
                body: [
                  [ {text:'Customer Name' ,style:'cell'}, {text:'Contact Number', style:'cell'},{text:'Email Address',style:'cell'},{text:'Address',style:'cell'}],
                  [name,contact,email,address]
                ],
              },
            },
            
              
            
        

        
        {
            table: { 
              widths: ['auto','*','auto','auto', 'auto','auto','auto','auto','auto' ,],
              body: [
                [ {text:'S/N',style:'cell'},{text:'Name',style:'cell'},{text:'Model',style:'cell'},{text:'IN Number',style:'cell'},{text:'IC Code',style:'cell'},{text:'Order Number',style:'cell'},{text:'Quantity',style:'cell'},{text:'Price',style:'cell'},{text:'Total',style:'cell'}],
                ...productDataArray.map((item,index)=>[index+1,item.productName,item.productmodel,item.productINnumber,item.productICnumber,item.productOrderNumber,item.productquantity,item.productfinalprice,`${item.productquantity * item.productfinalprice}.Rs`],)
              ],
            },
          },
          {style:'grandtotal',
          table: { 
            widths: ['*'],
            body: [
              [ {text:'Grand Total',style:'cell'},],
              [`${calculateTotalAmount(productDataArray)}.Rs`]
            ],
          },
        },
          {
            text:'Authorized Signature: _______________________',style:'signatureheader'
          },
          {
            text:'PowerPartsTraders',style:'footer'
          },{
            text:'Email: PowerPartsTraders@gamil.com',style:'footer'
          },{
            text:'Contact No: 03001234567 ',style:'footer'
          },{
            text:'Address: Shop 1,ABC Road,Tarnol,Islamabad,Pakistan',style:'footer'
          },
        
        
        
      ],
      styles: {
        imgcell:{margin:[0,0,10,0],},
        header: { fontSize: 25, bold: true, color: 'black', },
        subheader: { fontSize: 10,bold:true, margin: [330, 15, 10, 20],  },
        grandtotal: { fontSize: 15, margin: [385, 15, 0, 0],  },
        signatureheader: { fontSize: 10,bold:true, margin: [300, 50, 10, 50],  },
        tableHeader: {  fontSize: 10, margin:[0,10,0,10] },
        cell:{ fillColor: '#77C3EC'},
        footer:{fontSize:10,bold:true,margin:[0,5,5,5]}
        
      },
    };

    const pdfDocGenerator = pdfMake.createPdf(docDefinition);

    pdfDocGenerator.getBuffer((buffer) => {
      res.writeHead(200, {
        'Content-Type': 'application/pdf',
        'Content-Disposition': `attachment; filename=${invoicenumber}.pdf`,
        'Content-Length': buffer.length,
      });
      res.end(Buffer.from(buffer, 'binary'));
    });
      } catch (error) {
        console.error('Error generating PDF:', error);
      res.status(500).json({ error: 'Failed to generate PDF' });
      }

      
}
function calculateTotalAmount(items) {
  return items.reduce((total, item) => total + item. productquantity * item.productfinalprice, 0).toFixed(2);
}



module.exports = createinvoice